pub fn factor_combinations(&mut self, i: u32) -> Vec<Vec<u32>>
{
    self.combinations.clear();
    let mut factors: Vec<u32> = Vec::<u32>::new();
    self.backtrack(i, 2, i, factors.clone());
    return self.combinations.clone();
}


